server {
        listen 80; 
        listen [::]:80;
	server_name zeroproxy.atomike.ninja;
        return 301 https://$server_name$request_uri;

	location /.well-known/acme-challenge/ {
	    alias /path/to/challenges/;
	    try_files $uri =404;
	}
}


server {
        listen 443 ssl http2;
        listen [::]:443 ssl http2;
	server_name zeroproxy.atomike.ninja;

        # Définition de l'emplacement des logs
        access_log /path/to/access.log;
        error_log /path/to/error.log;

# Headers relatifs à la sécurité
        add_header Strict-Transport-Security "max-age=31536000; includeSubdomains";
        add_header X-Frame-Options "SAMEORIGIN" always;
        add_header X-Xss-Protection "1; mode=block" always;
        add_header X-Content-Type-Options "nosniff" always;
	    add_header Public-Key-Pins 'pin-sha256="k0/6pFwdCGD5Pu9smUpXntImc0P/Ahk8aB24l8+IOoE="; pin-sha256="t6BmyP+wz8Q7k5/qSNqvjcCObypUlXf6U8s41p3KnnI="; max-age=31536000';

# Configuration de TLS
        ssl_certificate /path/to/chained.pem;
        ssl_certificate_key /path/to/privkey.pem;
        ssl_ciphers "EECDH+AESGCM:EDH+AESGCM+aRSA:!SHA";
        ssl_protocols TLSv1.2;
        ssl_dhparam /etc/ssl/private/dhparams.pem;
        ssl_session_cache shared:SSL:10m;
        ssl_ecdh_curve secp384r1;

# OCSP Stapling
        ssl_stapling on;
        ssl_stapling_verify on;
        resolver 80.67.169.12 89.234.141.66 valid=300s;
        resolver_timeout 5s;
        ssl_trusted_certificate /etc/letsencrypt/ca-cert.pem;


# Le bazar qui fait le proxy
	location / {
        proxy_pass http://127.0.0.1:43110;
        proxy_set_header X-Real-IP  $remote_addr;
        proxy_set_header X-Forwarded-For $remote_addr;
        proxy_set_header Host $host;
	    proxy_set_header Upgrade $http_upgrade;
	    proxy_set_header Connection "upgrade";
	    proxy_http_version 1.1;
        }

}
